import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';
import memoComponent from './memoization/memo';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/memoization/memo">
                    <MemoComponent />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
